function Home() {



    return (
        <div>
            <NavBarRHome />

            <h4>Welcome to car rental system</h4>
            <div class="alert alert-info">
                <strong>Info!</strong> This alert box could indicate a neutral informative change or action.
            </div>





        </div>
    )

}
export default Home;
